import React from "react";

export default function WeatherTemperature(props) {
  return (
    <div className=" d-flex ">
      <span className="temperature ">{Math.round(props.celsius)} </span>
      <span className="unit">
        °{unit === "celsius" ? "C" : "F"} |{" "}
        <a
          href="/"
          onClick={(e) => {
            e.preventDefault();
            handleUnitChange();
          }}
        >
          °{unit === "celsius" ? "F" : "C"}
        </a>
      </span>
    </div>
  );
}
